import http from "../http-common";

const fetchData =  async () => {
  return http.get("/people");

  try {
    const response = await http.get('https://api.example.com/cards');
    return response.data;
  } catch (error) {
    throw new Error('Failed to fetch card data');
  }  
};

const api = {
    fetchData
  };

  export default api;
